id:
A JSON `STRUCTURE` for configuring static website hosting.
	Example:
	{
		"ErrorDocument": {
			"Key": "error.html"
		},
		"IndexDocument": {
			"Suffix": "index.html"
		},
		"RoutingRules": [
			{
				"Condition": {
					...
				},
				"Redirect": {
					...
				}
			}
		]
	}

translation:
Une `STRUCTURE` JSON pour configurer un hébergement de site Web statique.
 Exemple :
{
"ErrorDocument": {
			"Key": "error.html"
		},
"IndexDocument": {
			"Suffix": "index.html"
		},
"RoutingRules": [
{
"Condition": {
					...
				},
"Redirect": {
					...
				}
}
]
}

id:
A `STRUCTURE` using JSON syntax in a file.
	Example:
	{
		"CORSRules": [
			{
				"AllowedHeaders": ["*"],
				"AllowedMethods": ["PUT", "GET", "DELETE"],
				"AllowedOrigins": ["http://www.example.com"],
				"ExposeHeaders": ["ExposeHeader7", "ExposeHeader8"],
				"MaxAgeSeconds": 75
			}
		]
	}

translation:
Une `STRUCTURE` utilisant la syntaxe JSON dans un fichier.
 Exemple :
{
 "CORSRules": [
{
				"AllowedHeaders": ["*"],
				"AllowedMethods": ["PUT", "GET", "DELETE"],
				"AllowedOrigins": ["http://www.example.com"],
				"ExposeHeaders": ["ExposeHeader7", "ExposeHeader8"],
				"MaxAgeSeconds": 75
			}
]
}

