				"Status": "Enabled",
				"Priority": 1,
				"Filter": {
					"Prefix": ""
				},
				"DeleteMarkerReplication": {
					"Status": "Disabled"
				},
				"Destination": {
					"Bucket": "DEST-BUCKET-NAME"
				}
			}
		]
	}

